import axios from "axios";

const apikey = process.env.REACT_APP_APIKEY
const baseurl = process.env.REACT_APP_BASEURL

export const getJobList = async() => {
    const job = await axios.get(`${baseurl}/?company_num_employees=&employment_type=&location=&order_by=relevance&page=2&remote=&search=&source=dribbble/?api_key=${apikey}`)
    return job.data.results
}

export const searchJob = async(q) => {
    const search = await axios.get(`${baseurl}?search=query=${q}&api_key=${apikey}`)
    return search.data
}
